import styled from 'styled-components';

export const Main = styled.main`
    width:100%;
    padding: 80px 20px;
    background-color:#eceae9;

    display:flex;
    justify-content:center;
    align-items:center;
`;

export const BtnContainer = styled.div`
    max-width:600px;
    height:400px;
    width:90%;
    margin:0 30px;

    display:felx;
    justify-content:center;
    align-items:center;
    border:1px solid black;
`;
